In Postgres, JSON type is used for storing JSON data. Typeorm supports JSON type, but it is not directly available in the `@Column()` decorator. 

You can use `@Column('json')` decorator to specify the type of the column. Here is how you can do it:

```
import { Entity, Column, PrimaryGeneratedColumn } from 'typeorm';

@Entity()
export class MyEntity {
  @PrimaryGeneratedColumn()
  id: number;

  @Column('json')
  myJson: any;
}
```
In this example, `myJson` column will be created as a JSON type in the Postgres database. 

Note: You can also use `@Column('jsonb')` decorator to specify the type of the column as JSONB, which is a binary JSON type in Postgres.

